import web from "../src/images/web.jpeg";
import app from "../src/images/app.jpeg";
import software from "../src/images/software.jpg";
import android from "../src/images/android.jpg";
import digital from "../src/images/digital.png";
import marketing from "../src/images/marketing.jpeg";



const Sdata = [
    {
        imgsrc:web,
        title:"web development",
    },
    {
        imgsrc:app,
        title:"app development",
    },
    {
        imgsrc:software,
        title:"software development",
    },
    {
        imgsrc:android,
        title:"android development",
    },
    {
        imgsrc:digital,
        title:"digital marketing",
    },
    {
        imgsrc:marketing,
        title:" marketing",
    },
];


export default Sdata;
